Redescription. Length 8.0–14.0 mm. Body black, antennae dark brown, legs black to dark brown. Head. Clypeus and frons with round punctures each with a central seta; antennae reaching midpoint of lateral margin of pronotum; antennomere 9 longer than wide, with apical tomentose sensory patches arranged in two areas separated dorsally; antennomere 10 as wide as antennomere 11 . Thorax. Pronotum widest behind midpoint; disc glabrous or with setae, lateral quarters with fine golden setae; punctures of disc same size as punctures of elytron; width of anterior margin not exceeding half the width of posterior margin; lateral quarters convex, dorsal surface of lateral margin bearing a row of short golden setae (
Fig. 3
); posterior angles acute, apex pointed (
Fig. 22
); prosternum horizontal, with edge on anterior margin broadened below gula; prosternal process produced backwards, not reaching the midpoint of the space between pro– and mesocoxae (as in
Fig. 13
); prosternum and mesosternum with punctures. Elytron with two or three carinae equidistant between suture and lateral margin and three or four grooves bearing short, broad, golden, scaly setae (
Fig. 4
), intervals carina–shaped, wider than grooves; the inner groove runs from apex of elytron reaching only the posterior third, not surpassing the midpoint of elytron towards anterior, parallel with the inner groove of the other elytron, the medial groove runs from apex of elytron reaching the base towards anterior, the third and fourth outer grooves are very close together (or only the third groove) and run over lateral margin from apex of elytron reaching the base towards anterior (
Fig. 22
); dorsal surface glabrous; pseudopleuron with long setae arising on punctures; epipleuron with short setae arising on protuberances, with a row of setae on the edge of anterior quarter. Legs. Ventral surface of meso– and metafemora with a row of setae on posterior edge. Inner surface of meso– and metatibiae with long, fine setae. Metatibiae straight. Male genitalia. Rods of sterna IX “V”-shaped. Basal lamina of tegmen equal width throughout, with base concave. Lateral styles of tegmen with proximal margin ventrally bisinuate, widest at base, with setae on distal 1 / 5 of ventral surface. Median lobe moderate (0.75 <L/T ≤ 1.00), distally broadened, with apical aperture large and apex rounded. Female genitalia. Paraprocts moderate (1.2 ≤ P/C ≤ 2.0); baculi of coxite inclined 45 °; proctigeral baculus extending proximad much beyond paraproct baculus; apicodorsal lobe of proctiger extending about ½ length of coxite.
